import Person from '../models/person.js'
function NavBar() {

  let myGuy = {}

  function createAPerson(name, hairColor, hasGlasses, shirtColor, hasFacialHair, department, job){
    console.log(myGuy)
    myGuy = new Person(name, hairColor, hasGlasses, shirtColor, hasFacialHair, department, job)
    console.log(myGuy)
    return  myGuy
  }

  return (
    <>
    <ul>
      <li>{myGuy.name}</li>
      <button onClick={createAPerson('alf','blue', '','','','','')}>Make a person!</button>
    </ul>
    </>
  )
};

export default NavBar;
